import { style } from "typestyle";

const HowItWorkStyle = style({
    position: 'relative',
    backgroundColor: 'white',
    height: '50vh',
    margin: '100px 0',
    $nest: {
        '& .top-wave': {
            position: 'absolute',
            top: 0,
        },
        '& .top-title': {
            position: 'absolute',
            textAlign: 'center',
            fontFamily: 'GothamBold',
            color: 'white',
            fontSize: '67px',
            top: 10,
            left: 0,
            right: 0,
            margin: 'auto'
        }
    }
})

export default HowItWorkStyle
